import React from 'react';
import FilterCheckbox from '../containers/FilterCheckbox';
import { VisibilityFilters } from '../actions';

const Footer = () => (
  <div>
    <span>Show: </span>
    <FilterCheckbox filter={VisibilityFilters.SHOW_ALL}>All</FilterCheckbox>
    <FilterCheckbox filter={VisibilityFilters.NECKLACES_ONLY}>Collar Me Beautiful</FilterCheckbox>
    <FilterCheckbox filter={VisibilityFilters.BRACELETS_ONLY}>Wrist Action</FilterCheckbox>
    <FilterCheckbox filter={VisibilityFilters.EARRINGS_ONLY}>Lobe Trotters</FilterCheckbox>
  </div>
);

export default Footer;
